import React from "react";

// Add font import to the document head if not already present
if (typeof document !== 'undefined' && !document.getElementById('medievalsharp-font')) {
  const link = document.createElement('link');
  link.id = 'medievalsharp-font';
  link.rel = 'stylesheet';
  link.href = 'https://fonts.googleapis.com/css2?family=MedievalSharp&display=swap';
  document.head.appendChild(link);
}

const Header = ({ logo, title, navLinks, rightContent, transparent }) => (
  <header
    className={
      `flex items-center justify-between whitespace-nowrap px-10 py-3 ` +
      (transparent
        ? "bg-transparent border-none"
        : "border-b border-solid border-b-[#2b3640] bg-[#141a1f]")
    }
    style={transparent ? { boxShadow: 'none' } : {}}
  >
    <div className="flex items-center gap-4 text-white">
      <div>{logo || <img src="/logo.png" alt="Starbuilder Logo" className="w-[120px] h-full object-contain" />}</div>
      <h2 className="text-white text-lg font-bold leading-tight tracking-[-0.015em]" style={{ fontFamily: 'MedievalSharp, cursive' }}>{title}</h2>
    </div>
    <div className="flex flex-1 justify-end gap-8">
      <div className="flex items-center gap-9">
        {navLinks && navLinks.map((link, idx) => (
          <a key={idx} className="text-white text-sm font-medium leading-normal" href={link.href}>{link.label}</a>
        ))}
      </div>
      {rightContent && <div>{rightContent}</div>}
    </div>
  </header>
);

export default Header;
